import {Component} from 'react';
import { StudentConsumer } from './StudentInfo';

class Course extends Component{

    render(){
        return(
            <StudentConsumer>
                {
                    value=>{
                        return(
                            <div>
                                {value.id}
                            </div>
                        )
                    }
                }
            </StudentConsumer>
        )
    }
}
export default Course;
